import csv
import json

manifest=""

with open('wifi/Liste-Wifi.json') as f:
    wifis = json.load(f)

hashes = {}
with open('wifi/Liste-password', 'r', encoding='utf8') as passwords:
    for l in passwords.readlines():
        hash, mdp = l.split()
        hashes[hash] = mdp

for wifi in wifis:
    if wifi['hash'] in hashes:
        print(hashes[wifi])
    if wifi['hash'] in manifest:
        print(wifi['hash'])

for hash in hashes.keys():
    for char in 'abcdefghijklmnpqrstuvwxyz':
        if char*4 in hash:
            print(char, hash)


for hash in [wifi['hash'] for wifi in wifis]:
    for char in 'abcdefghijklmnpqrstuvwxyz':
        if char*4 in hash:
            print(char, hash)
